import './App.css';
import Header from './Header'
import Form from './Form/Form'
import Features from './Features'
import Footer from './Footer'

function App() {
  return (
    <div className="App">
      <Header/>
      <Form/>
      <Features/>
      <Footer/>

    </div>
  );
}

export default App;
